const { ethers } = require("ethers");
const Ipfs = require('ipfs')
const provider = new ethers.providers.JsonRpcProvider("http://localhost:8545");
const fs = require('fs');
const parser = require("node-html-parser");
const formidable = require('formidable');
const express = require('express');

const ADDRESS = "0xfD12Bf718C06E3C065553b887F9496dc2014c595";
const ABI = '[{"anonymous":false,"inputs":[{"indexed":false,"internalType":"string","name":"s","type":"string"}],"name":"NouveauFichier","type":"event"},{"constant":false,"inputs":[{"internalType":"string","name":"s","type":"string"}],"name":"payerStockage","outputs":[],"payable":true,"stateMutability":"payable","type":"function"},{"constant":true,"inputs":[],"name":"getNombreFichiers","outputs":[{"internalType":"uint256","name":"","type":"uint256"}],"payable":false,"stateMutability":"view","type":"function"},{"constant":true,"inputs":[{"internalType":"uint256","name":"ind","type":"uint256"}],"name":"recuperer","outputs":[{"internalType":"string","name":"","type":"string"}],"payable":false,"stateMutability":"view","type":"function"}]';

let contract = new ethers.Contract(ADDRESS, ABI, provider);

const app = express();
let node; 
app.use(express.static('public'));

async function getData(cid) {
	let data = "";
	const stream = node.cat(cid);
	for await (const chunk of stream) {
		data += chunk.toString('utf8');
	}
	return data;
}

 
app.get('/', function(req, res) {
	contract.getNombreFichiers().then(function(nmb) {
		fs.readFile('index.html', 'utf8', function(err, html) {
			const root = parser.parse(html);
			let fichiers = root.querySelector('#fichiers');
			var itemsProcessed = 0;
			if (nmb.toNumber()==0) {
				res.send(root.toString());
			}
			for (var i=0;i<nmb.toNumber();i++) {
				contract.recuperer(i).then(function(cid) {
					getData(cid).then(function(base64) {
						fichiers.appendChild('<a href="'+base64+'" download> <img src="file.png" alt="file" width="70" height="90"> </a>')
						//fichiers.appendChild('<a href="data:application/pdf;base64," download="test.pdf"><img src="file.png" alt="file" width="70" height="90"></a>')
						itemsProcessed++;
						if(itemsProcessed === nmb.toNumber()) {
							res.send(root.toString());
						}

					})

				})
			}
		})
	})

});

app.get("/getSource", function(req, res) {
	getData(req.query.hash).then(function(base64) {
		res.send(base64)
	})
})

app.post('/upload', function(req, res) {
	new formidable.IncomingForm().parse(req, (err, fields, files) => {
	    if (err) {
	      console.error('Error', err)
	      throw err
	    }
	    let path = files.document.path;
	    let content = fs.readFileSync(path, {encoding: 'base64'});
	    node.add("data:"+files.document.type+";base64,"+content).then(function(response) {
	    	node.pin.add(response.path).then(function(response2) {
	    		contract.getNombreFichiers().then(function(nmb) {
		    		fs.readFile('index.html', 'utf8', function(err, html) {
		    			const root = parser.parse(html);
		    			let body = root.querySelector("body");
		    			body.setAttribute("onload", "payerEpinglage('"+response.path+"')");

		    			let fichiers = root.querySelector('#fichiers');
		    			var itemsProcessed = 0;
		    			if (nmb.toNumber()==0) {
							res.send(root.toString());
						}

		    			for (var i=0;i<nmb.toNumber();i++) {
							contract.recuperer(i).then(function(cid) {
								getData(cid).then(function(base64) {
									fichiers.appendChild('<a href="data:text/plain;base64,'+base64+'" download> <img src="file.png" alt="file" width="70" height="90"> </a>')
									itemsProcessed++;
									if(itemsProcessed === nmb.toNumber()) {
										res.send(root.toString());
									}

								})

							})
						}
		    		})
		    	})
	    	});
	    })
  	})
})

async function main() {
	node = await Ipfs.create();
}
